import React from 'react';
import './App.css';
import Particles from 'react-particles-js';
import Microphone from './Microphone';

const App=()=>{

    return (
      <div className="App">
      <Particles className='parti'
    params={{
        particles: {
          number:{
            value:40,
            density:{
              enable:true,
              value_area:800
            }
          },
         move:
         {
           enable:true,
           speed:7
         },

        }
      }}/>
      <Microphone />
      </div>
    );

}

export default App;
